import { Link } from "react-router-dom/cjs/react-router-dom.min";
import "./Navigation.css";

const Navigation = () => {
  return (
    <nav className="navigation">
      <Link>Услуги</Link>
      <Link>Виджеты</Link>
      <Link>Интеграции</Link>
      <Link>Кейсы</Link>
      <Link>Сертификаты</Link>
    </nav>
  );
};

export default Navigation;
